import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import './App.css';
import Footer from './components/footer';
import Header from './components/header';

function App() {
    return (
        <Router>
            <div>
                <Header />
                <main className='py-3'>
                    <Container>
                        <h1>Welcome</h1>
                    </Container>
                </main>
                <Footer />
            </div>
        </Router>
    );
}

export default App;
